const ieStop = (function() {
	const imageData =
		'data:image/png;base64,';

	const grownUpBrowsers = [
		{
			name: 'Chrome',
			url: 'https://www.google.com/chrome/'
		},
		{
			name: 'Firefox',
			url: 'https://www.mozilla.org'
		},
		{
			name: 'Brave',
			url: 'https://brave.com/download/'
		}
	];

	/**
	 * returns TRUE if browser is IE (Edge is not IE)
	 */
	function isIE() {
		var ua = window.navigator.userAgent;

		var msie = ua.indexOf('MSIE ');
		var trident = ua.indexOf('Trident/');

		if (msie > 0 || trident > 0) {
			return true;
		}

		return false;
	}

	function buildLinks() {
		const linksWrapper = document.createElement('div');
		linksWrapper.style = 'margin-top: 200px';

		for (browser of grownUpBrowsers) {
			const link = document.createElement('a');
			link.href = browser.url;
			link.text = browser.name;
			link.style = 'font-size: 25px; margin: 30px';
			linksWrapper.appendChild(link);
		}

		return linksWrapper;
	}

	function buildImage() {
		const img = document.createElement('img');
		img.setAttribute('src', imageData);

		const div = document.createElement('div');
		div.appendChild(img);
		div.style = 'margin-bottom: 40px';
		return div;
	}

	function buildText() {
		const textNodes = [
			document.createTextNode(
				`Dear user, it appears that you are using Internet Explorer to browse the web.`
			),
			document.createTextNode(
				`The year is ${new Date().getFullYear()}. Please install another browser.`
			)
		];

		const divs = [];

		for (node of textNodes) {
			const el = document.createElement('div');
			el.appendChild(node);
			el.style = 'margin: 10px 0;';
			divs.push(el);
		}

		return divs;
	}

	function buildWrapperStyle() {
		return `
        position:fixed;
        left: 0;
        top: 0;
        bottom: 0;
        right: 0;
        z-index: 16777271;
        background: #B0E2FF;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        text-align: center;
        font-size: 40px;
        font-family: sans-serif !important;
        color: #333;
        `;
	}

	function createNoNoScreen() {
		const content = document.createElement('div');

		const textDivs = buildText();

		for (text of textDivs) {
			content.appendChild(text);
		}

		const wrapper = document.createElement('div');
		wrapper.style = buildWrapperStyle();

		wrapper.appendChild(buildImage());
		wrapper.appendChild(content);
		wrapper.appendChild(buildLinks());

		return wrapper;
	}

	return function(config) {
		if (isIE()) {
			// TODO: use config to customize screen

			const screen = createNoNoScreen();

			document.body.appendChild(screen);
		}

		// Good boy. nothing to do.
	};
})();

module.exports = ieStop;
